const AdminProfileRightSideBox = ({ createdby, reputation, users, setAdminUserClicked}) => {
    const handleAdminUserClicked = () => {
        setAdminUserClicked(true)
    }
    return (
        <>
            <div style={{height: "57vh", maxHeight: "57vh", overflow: "auto" }}>
                {users.map(user => (
                    <div style={{margin: "3%"}} key={user.username}>
                        <button className="hyperlinkButton" key={user.username}>{user.username}</button>
                    </div>
                ))}
            </div>
        </>
    )

}

export default AdminProfileRightSideBox;
